;; **
;;; # Vietnam IMO
;;; 
;;; Data from [this](http://www.imo-official.org/results.aspx), [this](https://en.wikipedia.org/wiki/International_Mathematical_Olympiad#Notable_achievements) and [this]( https://vi.wikipedia.org/wiki/Vi%E1%BB%87t_Nam_t%E1%BA%A1i_Olympic_To%C3%A1n_h%E1%BB%8Dc_Qu%E1%BB%91c_t%E1%BA%BF).
;; **

;; @@
(ns radioactive-firefly
  (:require [clojure.string :as str]
    		[gorilla-samples.util :refer :all]
    		[gg4clj.core :as gg4clj]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; ## International
;; **

;; @@
(def results (read-csv "imo/results.csv"))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;radioactive-firefly/results</span>","value":"#'radioactive-firefly/results"}
;; <=

;; **
;;; ### Top Countries
;; **

;; @@
(let [data        (filter #(contains? #{"Year" "CHN" "USA" "RUS" "HUN" "ROU" "KOR" "VNM" "BGR" "GER" "IRN"} (first %)) results)
      years       (->> (first data)
                       rest
	                   (map ->int))
      countries   (map first (rest data))
      ranking     (->> (rest data)
              	       (map rest)
                  	   (map #(map ->int %)))
      low-ranking (apply map max ranking)
      df 		  (gg4clj/data-frame {:years     (take (* (count countries) (count years)) (cycle years))
                  		              :countries (mapcat #(take (count years) (repeat %)) countries)
		                              :ranking   (mapcat #(map (fn [a b] (if (zero? b) b (- a b))) low-ranking %) ranking)})]
  (gg4clj/view [[:<- :g df]
                (gg4clj/r+
                  [:ggplot :g [:aes {:x :years, :y :countries, :height :ranking, :fill :countries}]]
                  [:geom_joy2 {:stat "identity" :show.legend :FALSE}]
                  [:scale_y_discrete {:expand [:c 0.01 0]}]
                  [:scale_x_continuous {:breaks [:seq 1960 2020 {:by 5}]
                                        :expand [:c 0 0]}]
                  [:theme_joy {:font_size 9}]
                  [:labs {:title    "Ranking"
                          :subtitle "*bigger is better"
                          :y        :NULL}])]))
;; @@
