;; **
;;; ## Vietnam
;; **

;; @@
(def vietnam (read-csv-with-header "imo/vietnam.csv"))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;radioactive-firefly/vietnam</span>","value":"#'radioactive-firefly/vietnam"}
;; <=

;; **
;;; ### Medals
;; **

;; @@
(let [data (->> vietnam
               (remove #(= "Không" (:medal %)))
               (group-by (juxt :year :medal))
               (map (fn [[[y m] v]] [(->int y) m (count v)])))
      df (gg4clj/data-frame {:year (map first data)
			                 :medal (map second data)
                             :no (map last data)})]
  (gg4clj/view [[:<- :g df]
                (gg4clj/r+
                  [:ggplot :g [:aes {:x :year, :y :no, :fill [:factor :medal [:c "Bằng khen" "HCĐ" "HCB" "HCV"]]}]]
                  [:geom_bar {:stat "identity"}]
                  [:scale_x_continuous {:breaks [:seq 1970 2020 {:by 5}]
                                        :expand [:c 0 0]}]
                  [:scale_y_continuous {:breaks [:seq 0 8]
                                        :expand [:c 0 0]}]
                  [:scale_fill_manual {:name "Medal"
                                       :values [:c "#56B4E9" "#a17419" "#b7b7b7" "#d5a500"]}]
                  [:theme {:axis.ticks [:element_blank]
                           :legend.position "top"
                           :text [:element_text {:size 9}]}])]))
