;; **
;;; ### All Schools
;; **

;; @@
(defn- name-normalize [name]
  (-> (if (str/blank? name) "N/A" name)
      (str/replace "THPT " "")
      (str/replace "Phổ thông " "")
      (str/replace "chuyên " "")
      (str/replace "năng khiếu " "")))

(gg4clj/view [[:<- :g (gg4clj/data-frame {:year   (map (comp ->int :year) vietnam)
			                              :school (map (comp name-normalize :school) vietnam)})]
                (gg4clj/r+
                  [:ggplot :g [:aes {:x :year, :y :school, :color :school}]]
                  [:geom_count {:show.legend :FALSE}]
                  [:scale_size_area {:max_size 3}]
                  [:scale_x_continuous {:breaks [:seq 1970 2020 {:by 5}]}]
                  [:theme {:axis.ticks [:element_blank]
                           :text [:element_text {:size 9}]}]
                  [:labs {:title "Schools"
                          :x :NULL, :y :NULL}])])
