(let [top-schools (take 10 schools)
      df (gg4clj/data-frame {:school (map first top-schools)
			                 :no     (map second top-schools)})]
  (gg4clj/view [[:<- :g df]
                (gg4clj/r+
                  [:ggplot :g [:aes {:x :school, :y :no, :fill :school}]]
                  [:geom_col {:width 0.9}]
                  [:coord_polar {:theta "y"}]
                  [:theme {:axis.text [:element_blank]
                           :axis.ticks [:element_blank]}]
                  [:scale_fill_brewer {:palette "Set3"}]
                  [:labs {:title "Top Schools"
                          :fill "Schools"
                          :x :NULL, :y :NULL}])]))
